import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
	const Array = [...props.expenseArray];

	return (
		<>
			{Array.map((element) => {
				return (
					<ExpenseItem
						key={element.id}
						title={element.title}
						amount={element.amount}
						date={element.date}
					/>
				);
			})}
		</>
	);
}

export default Expenses;
